#include <bits/stdc++.h>
using namespace std;


// } Driver Code Ends
//User function template for C++

class Solution{   
public:
    int median(vector<vector<int>> &matrix, int R, int C){
        int mi=INT_MAX;
        int mx=INT_MIN;
        for(int i=0;i<R;i++)
        {
            if(matrix[i][0]<mi)
            {
                mi=matrix[i][0];
            }
            if(matrix[i][C-1]>mx)
            {
                mx=matrix[i][C-1];
            }
        }
        int desired=(R*C+1)/2;
        int place;
        while(mi<mx)
        {
            place=0;
            int mid=mi+(mx-mi)/2;
            for(int i=0;i<R;i++)
            {
                place+=upper_bound(matrix[i].begin(),matrix[i].begin()+C,mid)-matrix[i].begin();
            }
            // cout<<place<<endl;
            if(place<desired)
            {
                mi=mid+1;
            }
            else
            {
                mx=mid;
            }
        }
        return mi;
        
        // code here          
    }
};


//{ Driver Code Starts.

int main()
{
    int t;
    cin>>t;
    while(t--)
    {
        int r, c;
        cin>>r>>c;
        vector<vector<int>> matrix(r, vector<int>(c));
        for(int i = 0; i < r; ++i)
            for(int j = 0;j < c; ++j)
                cin>>matrix[i][j];
        Solution obj;
        int ans=-1;
        ans=obj.median(matrix, r, c);
        cout<<ans<<"\n";        
    }
    return 0;
}
