const delayedColorChange = (color, delay) => {
	return new Promise((resolve, reject) => {
		setTimeout(() => {
			document.body.style.backgroundColor = color;
			resolve();
		}, delay);
	});

};

function repeatdelaycolorchange() {
	// Kode untuk mengubah warna atau melakukan tindakan lainnya
	delayedColorChange('red', 1000)
		.then(() => delayedColorChange('yellow', 1000))
		.then(() => delayedColorChange('green', 1000))
		.then(() => delayedColorChange('blue', 1000))
		.then(() => delayedColorChange('purple', 1000))
		.then(() => delayedColorChange('orange', 1000))
		.then(() => delayedColorChange('black', 1000));

	// Atur interval untuk memanggil fungsi ini setiap beberapa detik
	// Mengulang setiap 1000 milidetik (1 detik)
	setInterval(repeatdelaycolorchange, 3000);

}

// Memulai interval pertama kali
repeatdelaycolorchange();

package me.quadrato.simpleplayerworlds.commands;

import me.quadrato.simpleplayerworlds.Data.SpongeData;
import me.quadrato.simpleplayerworlds.Data.WorldData;
import me.quadrato.simpleplayerworlds.Helpers;

import org.spongepowered.api.Sponge;
import org.spongepowered.api.command.CommandException;
import org.spongepowered.api.command.CommandResult;
import org.spongepowered.api.command.CommandSource;
import org.spongepowered.api.command.args.CommandContext;
import org.spongepowered.api.command.spec.CommandExecutor;
import org.spongepowered.api.entity.living.player.Player;
import org.spongepowered.api.text.Text;
import org.spongepowered.api.text.format.TextColors;
import org.spongepowered.api.world.World;
import org.spongepowered.api.world.storage.WorldProperties;

import java.util.Optional;

public class WorldLoadCmd implements CommandExecutor {
    @Override
    public CommandResult execute(CommandSource src, CommandContext args) throws CommandException {
        if (src.hasPermission("spw.load")) {
            if (!(src instanceof Player)) {
                src.sendMessage(Text.of(Helpers.PLUGIN_PREFIX, TextColors.RED, "Only players can use this command."));
                return CommandResult.empty();
            }

            if (!args.hasAny("name")) {
                src.sendMessage(Text.of(Helpers.PLUGIN_PREFIX, TextColors.YELLOW, "/world load <world>"));
                return CommandResult.empty();
            }

            String worldName = args.<String>getOne("name").get();

            if (Sponge.getGame().getServer().getWorld(worldName).isPresent()) {
                src.sendMessage(Text.of(Helpers.PLUGIN_PREFIX, TextColors.DARK_RED, worldName, " is already loaded"));
                return CommandResult.empty();
            }

            WorldData worldData = new WorldData(worldName);

            if (!worldData.exists()) {
                src.sendMessage(Text.of(Helpers.PLUGIN_PREFIX, TextColors.DARK_RED, worldName, " does not exist"));
                return CommandResult.empty();
            }

            SpongeData spongeData = new SpongeData(worldName);

            if (!spongeData.exists()) {
                src.sendMessage(Text.of(Helpers.PLUGIN_PREFIX, TextColors.DARK_RED, "Foriegn world detected"));
                //src.sendMessage(Text.builder().color(TextColors.YELLOW).onHover(TextActions.showText(Text.of("Click command for more information "))).onClick(TextActions.runCommand("/pjw:world import")).append(Text.of(" /world import")).build());
                return CommandResult.empty();
            }

            Optional<WorldProperties> optionalProperties = Sponge.getGame().getServer().getWorldProperties(worldName);

            if (!optionalProperties.isPresent()) {
                src.sendMessage(Text.of(Helpers.PLUGIN_PREFIX, TextColors.DARK_RED, "Could not find ", worldName));
                return CommandResult.empty();
            }

            WorldProperties properties = optionalProperties.get();
            src.sendMessage(Text.of(Helpers.PLUGIN_PREFIX, TextColors.YELLOW, "Preparing spawn area. This may take a minute."));

            Sponge.getGame().getScheduler().createTaskBuilder().name(worldName).delayTicks(20).execute(new Runnable() {

                @Override
                public void run() {
                    Optional<World> load = Sponge.getGame().getServer().loadWorld(properties);

                    if (!load.isPresent()) {
                        src.sendMessage(Text.of(Helpers.PLUGIN_PREFIX, TextColors.DARK_RED, "Could not load ", worldName));
                        return;
                    }

                    World world = load.get();
                    world.setKeepSpawnLoaded(true);

                    //if (CMDCreate.worlds.contains(worldName)) {
                    //    Utils.createPlatform(load.get().getSpawnLocation().getRelative(Direction.DOWN));
                    //    CMDCreate.worlds.remove(worldName);
                    //}

                    src.sendMessage(Text.of(Helpers.PLUGIN_PREFIX, TextColors.DARK_GREEN, worldName, " loaded successfully"));
                }
            });
        } else {
            src.sendMessage(Text.of(Helpers.PLUGIN_PREFIX, TextColors.RED, " you do not have permissions to use this command."));
        }
        return CommandResult.success();
    }
}

