params ["_unit", "_pitchBank", "_pitch"];

_unit = _this select 0;

//adds user actions for non-patched planes 
if (_unit getVariable ['add_siren_action', 1] >= 1) then		//gets variable from stuka init script
{
	_unit addAction 
	[
		"Enable Siren", 
		{
			params ["_target", "_caller", "_actionId", "_arguments"];
			
			_target setVariable ['siren_toggle', 1];	//code
		},
		[],
		0,			//action menu priority, 1.5 is highest, 0 is lowest
		false,
		true,
		"",
		"_target getVariable ['siren_toggle', 1] == 0 && driver _target == player;",	//conditions
		7
	];
	
	_unit addAction 
	[
		"Disable Siren", 
		{
			params ["_target", "_caller", "_actionId", "_arguments"];
			
			_target setVariable ['siren_toggle', 0];
		},
		[], 
		0,
		false,
		true,
		"",
		"_target getVariable ['siren_toggle', 1] != 0 && driver _target == player;",
		7
	];
	
	_unit setVariable ['add_siren_action', 0];		//set value to 0 so that we don't keep adding user actions
};

sleep 2;	//wait 2 seconds when mission starts

//sleep command slows down the while loop so that we do not check/do everything in every frame (1 loop = 1 frame);
//checking/doing everything in each frame cause major preformance problems such as long loading times, infinite loading screen at start/end of mission, or game crashes

while {alive _unit && speed _unit >= 30} do		//go through this loop at each frame if the plane is alive and the planes speed is higher than 30km/h
{
	if (_unit getVariable ['siren_toggle', 1] != 0) then		//do this statement if siren_toggle is 1
	{
		_pitchBank = _unit call BIS_fnc_getPitchBank;	//get array
		_pitch = _pitchBank select 0;					//asign first element of the array to a value
		
		if (_pitch <= -15) then		//do this statement if the plane is diving down at a 15 degree angle or more
		{
			_unit say3d ["stuka_siren", 5000, 1, true];	//[sound class that contains the sound file, how far the sound can be heard, speed of the sound, is the sound speech]
			
			sleep 1.75;		//wait here for 1.75 seconds else we play a new sound at each frame (very bad), sound file is 3 seconds long, we do this else the sound will keep cutting off when hearing the sound far away
		}
		else
		{
			sleep 0.25;		//wait 1/4 of a second if plane is not diving
		};
	}
	else
	{
		sleep 0.25;		//wait 1/4 of a second if siren toggle is 0
	};
};

//when plane is under 30kp/h, exit while loop and do this statement
if (alive _unit) exitWith		//if plane is alive, do the following statement(s) before closing script else we no longer do function calls
{
	sleep 5;		//wait for 5 seconds so that the script does not call the same script at every frame when the plane is not moving
