                x = euler_path[r + 1].second;
                cnt[v]++;
                if (cnt[v] == 1) {
                    add(x);
                }
                else {
                    ira(x);
                }
                r++;
            }
            while (l < u.l) {
                v = euler_path[l].first;
                x = euler_path[l].second;
                cnt[v]--;
                if (cnt[v] == 1) {
                    add(x);
                }
                else {
                    ira(x);
                }
                l++;
            }
            while (l > u.l) {
                v = euler_path[l - 1].first;
                x = euler_path[l - 1].second;
                cnt[v]++;
                if (cnt[v] == 1) {
                    add(x);
                }
                else {
                    ira(x);
                }
                l--;
            }
            ans[u.id] = get_mex();
        }
    }
    for (i = 0; i < q; i++) {
        cout << ans[i] << endl;
    }
}

